const Candidate = (props) => {
  const item = props.item;

  return (
    <tr key={item.ca_id}>
      <td>{item.ca_id}</td>
      <td>{item.name}</td>
      <td>{item.address}</td>
      <td>{item.citizenshipid}</td>
      <td>{item.dob}</td>
      <td>{item.category_name}</td>
      <td>{item.party_name}</td>
      <td class="action">Delete</td>
    </tr>
  );
};

export default Candidate;
